      function getContractData() {
        var contractSegments = [];
        var contractEntities = [];
        var cseCount         = 0;
        contractSEData       = "";
        overlappingContracts = "";
        contractOverName     = "";
        var cdLength = contractData.length;
        document.getElementById("contractID").innerHTML = contractID + " - Segments & Entities";
        for (var cd = 0; cd < cdLength; cd++) {
          if (contractData[cd][1] == contractID) {
            contractSegments[cseCount] = contractData[cd][4];
            contractEntities[cseCount] = contractData[cd][5];
            cseCount++;
          }
        }
        var cseLength = contractEntities.length;
        for (var cse = 0; cse < cseLength; cse++) {
          contractSEData = contractSEData + "<tr><td>" + contractSegments[cse]+"</td><td>" + contractEntities[cse]+"</td></tr>";
          for (var cd = 0; cd < cdLength; cd++) {
            if ((contractData[cd][4]==contractSegments[cse]) && (contractData[cd][5]==contractEntities[cse]) && (contractData[cd][1]) != contractID) {
              if (contractOverName != contractData[cd][1]) {
                contractOverName = contractData[cd][1];
                overlappingContracts = overlappingContracts + "<tr><td>" + contractData[cd][1] + "</td><td>" + contractData[cd][2] + "</td><td>" + contractData[cd][3] + "</td><td>" + contractData[cd][4] + "</td><td>" + contractData[cd][5] + "</td></tr>";
              }
            }
          }
        }
        document.getElementById("contractSEData").innerHTML = "<table><tr><td class='header'>Contract Segment</td><td class='header'>Contract Entities</td></tr>" + contractSEData + "</table>";
        document.getElementById("overlappingContracts").innerHTML = "<table><tr><td class='header'>Contract ID</td><td class='header'>Source</td><td class='header'>Definition</td><td class='header'>Segment</td><td class='header'>Entity</td></tr>" + overlappingContracts + "</table>";
      }
    </script>
